that increments an integer by 1 
and registers it as a UDF with 
the SparkSession, which can be accessed
using the variable named "spark":
def inc(i: Integer): Integer = {
  i + 1
}
spark.udf.register ("inc", inc _)

*/

SELECT g.id AS game, p.id AS player, l.`number` AS last_lap FROM games g
JOIN current_game c ON g.id = c.game
JOIN players p ON p.id = g.player${record:value('/event')}
LEFT OUTER JOIN laps l ON l.game = g.id AND l.player = p.id
ORDER BY l.`number` DESC
LIMIT 1;
